import React from 'react';

function Projects() {
  return (
    <div className="projects">
      <div className="card">
        <h2>Project 1</h2>
        <p>Description of Project 1</p>
      </div>
      <div className="card">
        <h2>Project 2</h2>
        <p>Description of Project 2</p>
      </div>
      {/* Add more project cards as needed */}
    </div>
  );
}

export default Projects;
